import React, { useState, useEffect } from "react";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import DeleteIcon from "./Icon";
import "./Shifter.css";

const Shifter = (props) => {
  const [shifters, setShifters] = useState(props.data);
  const [isDeleted, setIsDeleted] = useState(true);

  useEffect(() => {
    setShifters(props.data)
  }, [props]);

  const deleteItemHandler = (id) => {
    const removedShifter = shifters.filter((shifter) => shifter.id === id);
    props.onChange(removedShifter);
    setIsDeleted(false);
  };
  console.log(shifters)
  return (
    <div>
      {shifters.map((shifter) => {
        const shifterId = shifter.id;
        const shifterTime = shifter.time;
        const shifterName = shifter.employee;
        return (
          <Grid
            container
            direction="row"
            justifyContent="space-between"
            alignItems="center"
            className="myBorder"
          >
            <Grid item>
              <Typography variant="h6">
                {shifterTime} <span>&nbsp;&nbsp;&nbsp;</span> {shifterName}
              </Typography>
            </Grid>
            <Grid item>
              <DeleteIcon onDelete={deleteItemHandler} data={shifter.id} />
            </Grid>
          </Grid>
        );
      })}
    </div>
  );
};
export default Shifter;
